def execute_program(instructions: list) -> int:
    ip_reg = 5
    reg = [0, 0, 0, 0, 0, 0]
    i = 0
    seen = set()
    while reg[ip_reg] < len(instructions):
        if reg[ip_reg] == 1:
            if reg[0] in seen:
                return reg[0]
            seen.add(reg[0])
        (op, a, b, c) = instructions[reg[ip_reg]]
        if op == 'addr':
            reg[c] = reg[a] + reg[b]
        elif op == 'addi':
            reg[c] = reg[a] + b
        elif op == 'mulr':
            reg[c] = reg[a] * reg[b]
        elif op == 'muli':
            reg[c] = reg[a] * b
        elif op == 'setr':
            reg[c] = reg[a]
        elif op == 'seti':
            reg[c] = a
        elif op == 'gtir':
            reg[c] = 1 if a > reg[b] else 0
        elif op == 'gtri':
            reg[c] = 1 if reg[a] > b else 0
        elif op == 'gtrr':
            reg[c] = 1 if reg[a] > reg[b] else 0
        elif op == 'eqir':
            reg[c] = 1 if a == reg[b] else 0
        elif op == 'eqri':
            reg[c] = 1 if reg[a] == b else 0
        elif op == 'eqrr':
            reg[c] = 1 if reg[a] == reg[b] else 0
        reg[ip_reg] += 1
    return reg[0]

